// RENTHIVE/client/src/pages/Login/Login.jsx

import React, { useState } from 'react';
import axios from 'axios';
import './Login.css'; // üëà CRITICAL: Ensure this import path is correct
// Assuming these are placed in client/src/assets/
import RentHiveLogo from '../../assets/image_7b7cd5.png'; // Updated Logo filename
import LoginIllustration from '../../assets/image_7b7f9c.png'; // Updated Illustration filename
import { FaFacebookF, FaGoogle, FaApple } from 'react-icons/fa'; 

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState(null); 

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);

    // Call the Login API (Phase 2)
    try {
        const response = await axios.post('http://localhost:5000/api/auth/login', { 
            email, 
            password 
        });

        localStorage.setItem('token', response.data.token);
        // Redirect logic here...

    } catch (err) {
        if (err.response && err.response.data && err.response.data.msg) {
            setError(err.response.data.msg);
        } else {
            setError('Login failed. Please try again.');
        }
    }
  };

  return (
    <div className="login-container">
      <div className="login-form-card">
        <img src={RentHiveLogo} alt="RentHive Logo" className="logo" />
        <h1 className="title">Login</h1>
        <p className="subtitle">Login to access your travelwise account</p>

        {/* Error Display */}
        {error && <div style={{ color: 'red', marginBottom: '15px', fontSize: '14px' }}>{error}</div>}

        <form onSubmit={handleSubmit} className="login-form">
          {/* Email Input */}
          <label htmlFor="email">Email</label>
          <input 
            type="email" 
            id="email" 
            placeholder="john.doe@gmail.com"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />

          {/* Password Input */}
          <label htmlFor="password">Password</label>
          <div className="password-input-wrapper">
            <input 
              type="password" 
              id="password" 
              placeholder="............"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <span className="password-toggle-icon">üëÅÔ∏è</span> 
          </div>

          <div className="remember-forgot-row">
            <label className="checkbox-container">
              <input 
                type="checkbox" 
                checked={rememberMe}
                onChange={(e) => setRememberMe(e.target.checked)}
              />
              Remember me
            </label>
            <a href="/forgot-password" className="forgot-password">Forgot Password</a>
          </div>

          <button type="submit" className="login-button">Login</button>
        </form>

        <p className="signup-link">
          Don't have an account? <a href="/register">Sign up</a>
        </p>

        <div className="social-login-separator">Or login with</div>

        <div className="social-buttons">
          <button className="social-btn facebook"><FaFacebookF /> Facebook</button>
          <button className="social-btn google"><FaGoogle /> G</button>
          <button className="social-btn apple"><FaApple /> </button>
        </div>
      </div>

      <div className="login-illustration-side">
        <img src={LoginIllustration} alt="House and Keys" />
      </div>
    </div>
  );
};

export default Login;
